        <img className="main-background-img" src="imgs/pexels-pixabay-326055.jpg" alt="배경화면" />
        <div className="main-create">
          {/*<Message text="여기에 컴포넌트들 바꿔서 들어가기" />*/}
          <input type="text"
                 placeholder="URL을 입력하세요."/>
          <button>저장하기</button>
        </div>
      </div>
      <MenuBar/>
    </div>
  );
};

export default Main;
